import React, { useState } from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';
import Home from '../../Home';
import Tools from '../../Tools';
import Services from '../../Services';
import About from '../../About';
import Contact from '../../Contact';

function Navbare() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  return (
    <div data-aos="fade-up" className="lg:mt-40">
      <nav className="navbar">
        <div className="logo" tabIndex="0">
          <Link to="/Home" className="link" data-feather="Projets">
            Home
          </Link>
        </div>
        <div className="logo" tabIndex="0">
          <Link to="/Tools" className="link" data-feather="Projets">
            Mon matériel
          </Link>
        </div>
        <div className="logo" tabIndex="0">
          <Link to="/Services" className="link" data-feather="Projets">
            Services
          </Link>
        </div>
        <div className="logo" tabIndex="0">
          <Link to="/About" className="link" data-feather="Projets">
            A propos
          </Link>
        </div>
        <div className="logo" tabIndex="0">
          <Link to="/Contact" className="link" data-feather="Projets">
            Contact
          </Link>
        </div>
        <div className="burger" onClick={toggleMenu}>
          <div className="line"></div>
          <div className="line"></div>
          <div className="line"></div>
        </div>
      </nav>
      {isMenuOpen && (
        <div className="mobile-menu">
          <div className="mobile-menu-links">
            <Link to="/Home" className="link" onClick={closeMenu}>
              Home
            </Link>
            <Link to="/Tools" className="link" onClick={closeMenu}>
              Mon matériel
            </Link>
            <Link to="/Services" className="link" onClick={closeMenu}>
              Services
            </Link>
            <Link to="/About" className="link" onClick={closeMenu}>
              A propos
            </Link>
            <Link to="/Contact" className="link" onClick={closeMenu}>
              Contact
            </Link>
          </div>
        </div>
      )}
    </div>
  );
}

export default Navbare;
